import React from 'react';
import { Typography } from "@material-ui/core";
import { Brightness1Outlined, Brightness3Outlined } from "@material-ui/icons"


const Logo = () => {
    return (
        <div>
            <Brightness1Outlined/>
            <Typography variant="h4">moonstripe</Typography>
            <Brightness3Outlined/>
        </div>
    )
}

export default Logo;
